# Definition for a binary tree node.
class TreeNode:
    def __init__(self, x):
        self.val = x
        self.left = None
        self.right = None


class Solution:
    def findComplementInRoot2(self, node, complement):
        if not node:
            return
        print(node.val, complement)
        if node.val == complement:
            return True

        return self.findComplementInRoot2(node.left, complement) or self.findComplementInRoot2(node.right, complement)

        # return found

    def twoSumBSTs(self, root1, root2, target):
        """
        hash table
        VLR tree traversal in root1 and root2
        """
        ha = {}
        if not root1 or not root2:
            return None
        print('node.val =', root1.val)
        complement = target - root1.val
        print('complement =', complement)
        if ha.get(complement) != False:
            if self.findComplementInRoot2(root2, complement):
                return True
            else:
                ha[complement] = False
        return self.twoSumBSTs(root1.left, root2, target) or self.twoSumBSTs(root1.right, root2, target)


